idinfo.useconst:
The data set is a generalized zoning data coverage. It does not show zoning for areas inside Urban Growth Boundaries. The data was digitized off of 100k usgs maps containing hand drawn zoning boundaries. These boundaries represent data collected from 1983 through 1986. While only limited changes have occured outside urban growth boundaries since than, changes have occured. The coverage is not to be used to determine zoning for a specific location. Specific information should be obtained from the county the site resides in. In areas of southern Oregon (Rogue Valley) the complexity of the zoning did not allow a separation of rural residential and agricultural zoning.
